import React from 'react';

function SponsorCard({ img, name, role, detail }) {
  return (
    <div className="flex flex-col justify-center max-w-full py-1 w-full h-auto shadow-md rounded-xl sm:px-4 dark:bg-gray-50 dark:text-gray-800">
      <img
        src={img}
        alt={name}
        className="w-24 h-24 mx-auto rounded-full object-cover dark:bg-gray-500"
      />
      <div className="space-y-2 text-center divide-y dark:divide-gray-300 mt-3">
        <div className="my-2 space-y-1">
          <h2 className="text-lg font-semibold sm:text-md">{name}</h2>
          <h4 className="text-lg font-semibold sm:text-md">{role}</h4>
          <i>
            <p className="text-xs sm:text-base dark:text-gray-600 font-light">{detail}</p>
          </i>
        </div>
      </div>
    </div>
  );
}

export default SponsorCard;
